import React, { useState } from "react";
import { stack as Menu } from "react-burger-menu";
import { Link } from "react-router-dom";

const Burger = () => {
  const [close, setClose] = useState(false);
  return (
    <Menu right>
      <ul>
        <li
          onClick={() => {
            setClose(true);
          }}
        >
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </ul>
    </Menu>
  );
};

export default Burger;
